interface PCAData {
  pc1: number[];
  pc2: number[];
  pc3: number[];
  area: string[];
  hovertext: string[];
}

export const PCAChart = () => {
  const chartRef = useRef<HTMLDivElement>(null);

  function parsePCAData(csvData: string): PCAData {
    const lines = csvData.trim().split('\n');
    const data: PCAData = {
      pc1: [],
      pc2: [],
      pc3: [],
      area: [],
      hovertext: []
    };

    for (let i = 1; i < lines.length; i++) {
      const values = lines[i].split(',');
      const area = values[0];
      const year = values[1];
      data.pc1.push(parseFloat(values[8])); // PC1 is at index 8
      data.pc2.push(parseFloat(values[9])); // PC2 is at index 9
      data.pc3.push(parseFloat(values[10])); // PC3 is at index 10
      data.area.push(area);
      data.hovertext.push(`${area} - ${year}`);
    }
    return data;
  }

  useEffect(() => {
    if (!chartRef.current) return;

    const pcaData3D = parsePCAData(rawPcaData);
    
    const pcaTrace = {
      x: pcaData3D.pc1,
      y: pcaData3D.pc2,
      z: pcaData3D.pc3,
      text: pcaData3D.hovertext,
      hoverinfo: 'text',
      mode: 'markers',
      type: 'scatter3d',
      marker: {
        size: 6,
        color: pcaData3D.pc1,
        colorscale: 'Viridis',
        opacity: 0.8,
        colorbar: {
          title: 'PC1 Value',
          titlefont: {
            color: '#ffffff'
          },
          tickfont: {
            color: '#ffffff'
          }
        }
      }
    };

    const pcaLayout = {
      title: {
        text: '   -',
        font: {
          family: 'Inter, sans-serif',
          size: 18,
          color: '#ffffff'
        },
        y: 0.95
      },
      scene: {
        xaxis: { 
          title: 'PC1', 
          range: [-1, 1],
          titlefont: { color: '#ffffff' },
          tickfont: { color: '#ffffff' },
          gridcolor: '#444444'
        },
        yaxis: { 
          title: 'PC2', 
          range: [-1, 1],
          titlefont: { color: '#ffffff' },
          tickfont: { color: '#ffffff' },
          gridcolor: '#444444'
        },
        zaxis: { 
          title: 'PC3', 
          range: [-1, 1],
          titlefont: { color: '#ffffff' },
          tickfont: { color: '#ffffff' },
          gridcolor: '#444444'
        },
        bgcolor: '#0f0f23',
        camera: {
          eye: { x: 1.5, y: 1.5, z: 1.5 }
        }
      },
      margin: { l: 0, r: 0, b: 0, t: 50 },
      paper_bgcolor: 'transparent',
      plot_bgcolor: 'transparent',
      font: {
        family: 'Inter, sans-serif',
        color: '#ffffff'
      }
    };

    const config = {
      responsive: true,
      displayModeBar: true,
      modeBarButtonsToRemove: ['pan2d', 'lasso2d'],
      displaylogo: false
    };

    Plotly.newPlot(chartRef.current, [pcaTrace], pcaLayout, config);

    return () => {
      if (chartRef.current) {
        Plotly.purge(chartRef.current);
      }
    };
  }, []);

  return (
    <div 
      ref={chartRef} 
      className="w-full h-[500px] rounded-lg border border-primary/20 bg-card/50 backdrop-blur-md"
      style={{ direction: 'ltr' }}
    />
  );
};
